                <h2>Web Developer</h2>
                <p>
                    I'm a professional <span className='uxDesigner'>UX Designer</span> and Front-End Developer creating modern and resposive designs to Web and Mobile. Let us work together. Thank you.
                </p>
                <div className='btnContainer'>
                    <button>Get Started</button>
                </div>
            </div>
        </section>
    )

}


export default LandingPage;
